INSERT INTO Audit_benefits(FileName, Operation, StartTime)
Values('Section_C', 'Data_Cleaning', (Select GETDATE()));
Select * from Audit_benefits;

DECLARE @file as NVARCHAR(MAX)
set @file = 'Section_C';

Update Audit_benefits
set EndTime = (Select GETDATE())
where Id = (select Max(Id) from Audit_benefits 
where (CONVERT(VARCHAR, FileName)= @file and Operation = 'Data_Cleaning'));

Update Audit_benefits
SET Status = 'pass'
where Id = (select Max(Id) from Audit_benefits 
where (CONVERT(VARCHAR, FileName)= @file and Operation = 'Data_Cleaning'));

Update Audit_benefits
set Timetaken = EndTime-StartTime
where Id = (select Max(Id) from Audit_benefits 
where (CONVERT(VARCHAR, FileName)= @file and Operation = 'Data_Cleaning'));

